plt.plot(Time_, Roll_, color="r", alpha=1, linewidth=3, label="Average Step Roll Angle")
plt.plot(Time_, Pitch_, color="b", alpha=1, linewidth=3, label="Average Step Pitch Angle")
plt.legend()    
plt.show()



